--
-- Table structure for table `books`
--

DROP TABLE IF EXISTS `books`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `books` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'УИД книги',
  `product_id` int unsigned NOT NULL COMMENT 'Идентификатор товара',
  `publishing_house_id` int unsigned NOT NULL COMMENT 'Идентификатор издательства',
  `series_id` int unsigned DEFAULT NULL COMMENT 'Идентификатор серии',
  `genre_id` int unsigned NOT NULL COMMENT 'Идентификатор жанра',
  `author` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Автор',
  `language` varchar(5) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Язык',
  `year` int NOT NULL COMMENT 'Год издания',
  `isbn` varchar(35) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'ISBN',
  `number_pages` int NOT NULL COMMENT 'Кол-во страниц',
  `circulation` int NOT NULL COMMENT 'Тираж',
  `new` tinyint(1) NOT NULL,
  `miniature` tinyint(1) NOT NULL,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название',
  `cover_type_id` int unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `books_product_id_fk` (`product_id`),
  KEY `books_publishing_house_id_fk` (`publishing_house_id`),
  KEY `books_series_id_fk` (`series_id`),
  KEY `books_genre_id_fk` (`genre_id`),
  KEY `books_cover_type_id_fk` (`cover_type_id`),
  CONSTRAINT `books_cover_type_id_fk` FOREIGN KEY (`cover_type_id`) REFERENCES `cover_types` (`id`),
  CONSTRAINT `books_genre_id_fk` FOREIGN KEY (`genre_id`) REFERENCES `product_types` (`id`),
  CONSTRAINT `books_product_id_fk` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`),
  CONSTRAINT `books_publishing_house_id_fk` FOREIGN KEY (`publishing_house_id`) REFERENCES `publishing_houses` (`id`),
  CONSTRAINT `books_series_id_fk` FOREIGN KEY (`series_id`) REFERENCES `series` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=251 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Книги';
/*!40101 SET character_set_client = @saved_cs_client */;

