--
-- Table structure for table `orders`
--

DROP TABLE IF EXISTS `orders`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `orders` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'УИД заказа',
  `user_id` int unsigned NOT NULL COMMENT 'Идентификатор покупателя',
  `order_number` varchar(25) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Идентификатор типа товара',
  `order_date` datetime NOT NULL COMMENT 'Дата оформления заказа',
  `address` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Адрес доставки',
  `cost` decimal(11,2) NOT NULL COMMENT 'Стоимость заказа',
  `delivery_service` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Идентификатор службы доставки',
  `state` int NOT NULL DEFAULT (0) COMMENT 'Состояние заказа (0-не оплачен, 1-оплачен, 2-формируется на складе, 3-доставляется, 4-доставлен, 5-завершён.)',
  `payment_date` datetime NOT NULL COMMENT 'Дата оплаты',
  `delivary_date` datetime NOT NULL COMMENT 'Дата доставки',
  `order_ditails` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Реквизиты заказа',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Дата создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_number` (`order_number`),
  KEY `orders_user_id_fk` (`user_id`),
  CONSTRAINT `orders_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Заказы';
/*!40101 SET character_set_client = @saved_cs_client */;

