DROP TABLE IF EXISTS `product_types`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `product_types` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'УИД типа товара',
  `parent_id` int unsigned NOT NULL COMMENT 'Идентификатор типа товара',
  `level` int NOT NULL DEFAULT '0' COMMENT 'Уровень типа (0-4).',
  `product_type` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Наименование типа товара',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=67 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Справочник типы товаров';
/*!40101 SET character_set_client = @saved_cs_client */;

