--
-- Table structure for table `products`
--

DROP TABLE IF EXISTS `products`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `products` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'УИД товара',
  `product_type_id` int unsigned NOT NULL COMMENT 'Идентификатор типа товара',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название',
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Описание',
  `format` varchar(25) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Размер/Формат(25.5 x 25.5 x 6.3)',
  `weight` int NOT NULL COMMENT 'Вес, г',
  `anotation` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Анотация',
  `available` int NOT NULL DEFAULT '0' COMMENT 'Доступно (общее количество товара)',
  `price` decimal(11,2) NOT NULL COMMENT 'Цена',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `products_product_type_id_fk` (`product_type_id`),
  CONSTRAINT `products_product_type_id_fk` FOREIGN KEY (`product_type_id`) REFERENCES `product_types` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=205 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Товары (Товарная позиция)';
/*!40101 SET character_set_client = @saved_cs_client */;

