x 64 x 8',261,'Est similique facilis magni impedit harum ea maxime. Reprehenderit occaecati delectus modi qui maxime. Sit asperiores voluptas dolores natus aut.',1,194.00,'2020-06-12 01:29:18','2020-12-07 11:46:59'),(15,51,'Настольная игра \"Азбука Мурррзе\": на 2-6 игроков','Азбука Мурррзе\" - настольная игра для тех, кто умеет или хочет научиться внимательно слушать!','13 x 13 x 4',170,'\"Азбука Мурррзе\".\nМаленькие котята очень любят играть в шпионов и для хранения своих секретов, они придумали специальный код - азбуку Мурррзе. Пробравшись на кухню, котята ищут, чем бы подкрепиться! Один котёнок с помощью азбуки Мурррзе передаёт, какие продукты надо искать, а остальные котята расшифровывают код и как можно быстрее хватают нужную карточку с едой.\nНастольная игра \"Азбука Мурррзе\" - игра активная, яркая, с забавной темой. Но главная её особенность в том, что в этой игре для детей задействован слух.\nАзбука Мурррзе основана на количестве слогов в словах. Каждый слог отбивается ударом ложки о стол, а число ударов определяет слово. Игра помогает детям почувствовать слоговую структуру слова. Хорошая тренировка перед тем, как начать читать и писать!\nКаждый раунд один из игроков в роли ведущего зашифровывает одну из карточек добычи, лежащих на столе. Он отбивает код ложкой, а котята-шпионы внимательно его слушают спешат найти и накрыть ладошкой соответствующую карточку добычи.\nДеревянная ложка входит в комплект!\nКому подойдёт эта игра?\n- детям, которые любят повеселиться,\n- логопедам, воспитателям и педагогам\n- всем, кто любит котят\n- семьям, где хотя поиграть все вместе\n- для первого знакомства с играми.',1,160.00,'2020-05-11 04:00:40','2020-12-11 09:17:03'),(16,7,'Iusto quos et ab.','Sint ut fugiat culpa quis ea. Dolorem ad voluptatibus consectetur labore pariatur et aliquam sit. Ut voluptatem officia alias maiores dolorum.','75 x 43 x 8',150,'Adipisci incidunt et accusantium consequatur voluptatibus. Aut incidunt molestias cum vitae aliquam accusamus natus.