оборот, рискнуть и получить добычу побольше. В этой игре всегда надо быть настороже!\nКрасивое игровое поле с белоснежными льдинами и 15 деревянных фигурок помогут игрокам почувствовать дыхание севера и погрузиться в атмосферу Арктики.',1,1490.00,'2020-03-25 17:03:14','2020-12-11 09:17:06'),(118,34,'Sit et velit incidunt debitis id.','Modi quia at rerum enim. Rem quo exercitationem mollitia quasi et sint. Omnis quo nostrum quod sunt sit et occaecati.','93 x 70 x 5',49,'Dolore reprehenderit unde non blanditiis placeat delectus. Harum molestiae asperiores quia reprehenderit. Voluptates atque voluptate ut odit commodi.',9,868.00,'2020-09-27 01:00:37','2020-12-07 11:46:59'),(119,16,'Laborum praesentium nihil suscipit magnam.','Adipisci voluptatem iusto non cum quia sunt. Fugiat qui ut quis vel quia. Rem temporibus labore non consequatur ut rem. Non et incidunt quae excepturi ut et numquam id.','51 x 62 x 2',112,'Omnis porro similique consectetur quis illo dolore eaque. Reiciendis aut maxime voluptatem laboriosam minus. Et aut vel consectetur doloribus ad eum deserunt.',9,509.00,'2020-10-07 14:05:48','2020-12-07 11:46:59'),(120,44,'Alias veniam voluptate amet sit sit vel voluptatum.','Excepturi non id quis eum consequatur illum quis. In suscipit sed ut minima nisi aut. Et eveniet cumque atque sit minima voluptates officia omnis. Sit distinctio provident suscipit perspiciatis soluta.','50 x 52 x 2',411,'Sequi cumque debitis impedit dolore. Quaerat placeat provident ducimus numquam eveniet nesciunt. Ut non tempora sint sunt saepe alias voluptatem.',5,844.00,'2020-04-25 06:10:23','2020-12-07 11:46:59'),(121,38,'Consequatur aut est sit quis.','Voluptatibus aut adipisci rerum blanditiis quo. Praesentium qui ipsum totam rerum. Impedit rerum fugit omnis voluptatem aut quos quis. Vel quo animi reiciendis quasi.','82 x 62 x 4',222,'Dolor error tenetur qui dolores quos. Quo molestiae voluptate molestiae iusto vel ipsam dolores vero.',1,595.00,'2020-08-18 16:08:48','2020-12-07 11:4