айти что-нибудь вкусненькое.\nКак играть\n1. Выберите одного из лесных жителей.\n2. Все игроки одновременно решают, в какую из частей леса пойдут за едой их животные, и откладывают нужную карточку лицом вниз.\n3. Карточки местности открываются, все узнают планы друг друга и сравнивают их. Для животных, оказавшихся в одной местности, действуют определённые правила: более крупные животные пугают маленьких, более быстрые звери опережают медленных. Также зверей может спугнуть охотничья собака, бегающая по лесу.Не все лесные жители смогут пообедать в этот день!\n4. Игроки, животные которых получают еду, тянут карточки еды. Однако забрать себе могут только то, что ест их животное.\n5. Побеждает игрок, который первым полностью накормит своё животное.\nКому подойдёт эта игра?\n- Всем, кто любит животных\n- Юным исследователям окружающего мира\n- Семье для тёплого семейного досуга.',1,590.00,'2020-11-28 09:01:01','2020-12-11 09:17:09'),(189,29,'Ipsam fugit soluta ut harum.','Illo ut qui nihil quam. Facere voluptas eos ipsa harum perspiciatis laborum. Totam voluptatem autem ab sunt quibusdam consequatur placeat.','73 x 72 x 9',296,'Qui laudantium et consectetur architecto quia. Et ea architecto animi at assumenda at facere. Maxime consequatur quos sed voluptatum necessitatibus. Velit iure sint sed et.',2,723.00,'2020-12-24 21:51:18','2020-12-07 11:46:59'),(190,59,'Occaecati saepe harum neque ipsa corrupti nostrum et.','Enim dolorum sed voluptatem occaecati a. Ex dolorem perspiciatis optio sapiente. Sed odio ipsum aut odio dolor.','89 x 44 x 2',349,'Dignissimos laboriosam est ea dolor numquam vel quae. Amet velit assumenda nesciunt rerum officia reiciendis. Et nulla nostrum rerum sit officia. Adipisci error voluptas magni sint.',6,464.00,'2020-08-20 09:57:47','2020-12-07 11:46:59'),(191,7,'Quod ut rerum nihil recusandae est qui.','Sunt rerum magnam dolorem soluta quo consequatur consequatur. Consequatur non rerum sunt et occaecati qui quia necessitatibus. Quis autem et volupta