CREATE TABLE `promotions` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор акции',
  `start_date` datetime NOT NULL COMMENT 'Дата начала акции',
  `end_date` datetime NOT NULL COMMENT 'Дата окончания акции',
  `discount` int NOT NULL COMMENT '% скидки',
  `bonuse` int NOT NULL COMMENT 'Бонусы',
  `description` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Описание',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Акции';
