CREATE TABLE `seсurity` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'УИД записи',
  `user_id` int unsigned NOT NULL COMMENT 'Идентификатор покупателя',
  `pwd` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'ХЭШ пароля',
  `state` tinyint(1) NOT NULL,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Дата создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `security_user_id_fk` (`user_id`),
  CONSTRAINT `security_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=151 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Sequrity';
