DROP TABLE IF EXISTS `shops`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `shops` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'УИД магазина',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название',
  `city` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Город',
  `address` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Адрес',
  `time_work` varchar(75) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Время работы',
  `phone` varchar(75) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Телефон',
  `description` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Описание',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Магазины';
