/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `check_product_id_user_id_update` BEFORE UPDATE ON `users_products` FOR EACH ROW BEGIN 
	-- Если товар уже в корзине увеличиваем количество товара на 1
	IF EXISTS (SELECT 1 FROM users_products WHERE user_id = NEW.user_id AND product_id = NEW.product_id) THEN 
		SET NEW.product_count = OLD.product_count + NEW.product_count;
	END IF;
END */;;
